import axios from 'axios';

export function authenticatedSubmitMaxes(id, squat, bench, deadlift, ohp, powerclean, goal, history) {
	return (dispatch) => {
		axios({
			method: 'put',
			url: 'http://localhost:3000/maxes',
			data: {
				id: id,
				squat: squat,
				bench: bench,
				deadlift: deadlift,
				ohp: ohp,
				powerclean: powerclean
			}
		})
			.then(maxes => {
				if (maxes && goal === 'strength') {
					dispatch ({type: 'UPDATED_MAXES_AUTHENTICATED', payload: maxes.data})
					history.push('/strength')
				} else {
					dispatch ({type: 'UPDATED_MAXES_AUTHENTICATED', payload: maxes.data})
					history.push('/bodybuilding')
				}
		});
	};
};

export function unauthenticatedSubmitMaxes(squat, bench, deadlift, ohp, powerclean, goal, history) {
	return (dispatch) => (
		dispatch({
			type: 'UPDATED_MAXES_UNAUTHENTICATED',
			payload: {
				squat,
				bench,
				deadlift,
				ohp,
				powerclean
			}})
	)
	if (goal === 'strength') {
		history.push('/strength')
	} else {
		history.push('/bodybuilding')
	}
}
